window.bookSummaryJSON = "<p>Leader of the most powerful army in the heavens, Zacharel has been deemed nearly too dangerous, too ruthless - and if he isn't careful, he'll lose his wings. But this warrior with a heart of ice will not be deterred from his missions at any costâ€¦until a vulnerable human tempts him with a carnal pleasure he's never known before. </p> <p>Accused of a crime she did not commit, Annabelle Miller has spent four years in an institution for the criminally insane. Demons track her every move, and their king will stop at nothing to have her. Zacharel is her only hope for survival, but is the brutal angel with a touch as hot as hell her salvation - or her ultimate damnation?</p>"; 
